double sig(double a, double a1, double a2, double p){
	double No=(1.0-p)/(pow((a2/a1), 1.0-p)-1.0);
	return No*pow((a/a1), -p);
	// return a2;
}

double torque_integ(double a1, double a2, double p, double e0, double q, double r1x, double r1y, double r1z, double b){
	double tot=0;
	double a=a1;
	int N=100;
	double deltaA=(a2-a1)/N;
	int i=0;
	for (i=0; i<N; i++){
		tot+=sig(a, a1, a2, p)*torque_z(a, e0*pow(a/a1, q), r1x, r1y, r1z, b)*deltaA;
		a+=deltaA;
	}
	return tot;
}

double torque_tot(double a1, double a2, double p, double e0, double q, double e_test, double a_test, double omega_test, double b, int N, int flag){
	double tot=0;
	double deltaOm=2.0*Pi/N;
	int i=0;
	double om=1e-4+flag*deltaOm/0.5;
	printf("%f \n", om);
	double r1=1;
	for (i=0; i<N; i++){
		r1=a_test*(1.0-pow(e_test, 2.0))/(1.0+e_test*cos(om-omega_test));
		tot+=torque_integ(a1, a2, p, e0, q, r1*cos(om), r1*sin(om), 0.0, b)*pow((1.0-pow(e_test, 2.0)), 1.5)/(2.0*Pi)*deltaOm/pow(1.0+e_test*cos(om-omega_test), 2.0);
		om+=deltaOm;

	}
	return tot;
}

int main(int argc, char* argv[]){
	char* tag="a";
	if (atoi(argv[5])){
		tag="b";
	}

	double m = 2.5e-7;
	double norm=1000.0*pow(m,2.0);
	char fname[80]="";
    strcat(fname, "tau");
    strcat(fname,"_");
    strcat(fname, tag);
    int i=1;
    for (i=1; i<4; i++){
        strcat(fname, "_");
        strcat(fname, argv[i]);
    }
    printf("%s\n",fname);
    FILE *f=fopen(fname, "w");
	fprintf(f, "%0.10e\n", norm*torque_tot(1.0, 2.0, 1.01, 0.7, 0.0, atof(argv[1]), atof(argv[2]), atof(argv[3])*Pi/180.0, 1.0e-4, atoi(argv[4]), atoi(argv[5]) ));
	fclose(f);

	return 0;


}